import React from "react";

import "./ChartBar.css"

const ChartBar = (props)=> {
return (<div className="chart-bar">
<div className="chart_bar__inner">
    <div className="chart_bar__fill"></div>
</div>
 <div className="chart_bar__label"></div>
</div>)
}

export default ChartBar;
